import React, { useState, useEffect } from "react";
import { Modal, Button } from "react-bootstrap";
import axios from "axios";

const Popup = ({ title, message, onClose }) => {
    const [showPopup, setShowPopup] = useState(true);
    const [exerciseData, setExerciseData] = useState(null);

    useEffect(() => {
        setShowPopup(true);
        fetchData();
    }, []);

    const fetchData = async () => {
        const options = {
            method: "GET",
            url: "https://exercises2.p.rapidapi.com/",
            headers: {
                "X-RapidAPI-Key": "e1adbd36b9mshc46c4493c255e06p1dfbe5jsn1b91a9c972a7",
                "X-RapidAPI-Host": "exercises2.p.rapidapi.com",
            },
        };

        try {
            const response = await axios.request(options);
            setExerciseData(response.data);
        } catch (error) {
            console.error(error);
        }
    };

    const handleClose = () => {
        setShowPopup(false);
        onClose();
    };

    return (
        <Modal show={showPopup} onHide={handleClose} centered>
            <Modal.Header closeButton>
                <Modal.Title>Titel på övningen</Modal.Title>
            </Modal.Header>
            <Modal.Body>vad du ska göra typ</Modal.Body>
            <Modal.Footer></Modal.Footer>
        </Modal>
    );
};

export default Popup;
